import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';



import Home from "./views/Home";
import Carrito from "./views/Carrito";
import InicioSecion from "./views/InicioSecion";
import Registro from "./views/Registro";
import CrearPub from "./views/CrearPub";
import MiPerfil from "./views/MiPerfil";
import Detalle from "./views/Detalle";
import Tecnologia from "./views/Tecnologia";
import Vestuario from "./views/Vestuario";




function App() {
  return (
    <div className="App">

        <BrowserRouter>
       <Navbar/>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/carrito" element={<Carrito />} />
          <Route path="/vestuario" element={<Vestuario />} />
          <Route path="/tecnologia" element={<Tecnologia />} />
          <Route path="/miperfil" element={<MiPerfil />} />
          <Route path="/InicioSecion" element={<InicioSecion />} />
          <Route path="/registro" element={<Registro />} />
          <Route path="/crearpub" element={<CrearPub />} />
          <Route path="/producto/:id" element={<Detalle />} />
        </Routes>
        </BrowserRouter>

    </div>
  );
}

export default App;
